import json
import geojson
from sys import stdin
from shapely import wkt

def convert_json_to_geojson(json_data,geometry_name="geometry"):
	#Parsing JSON data
	feature = []
	for val in json.loads(json_data):
		# print(val)
		parsed_json = val

		# Converting to GeoJSON feature
		properties = {}
		for key, value in val.items():
			if key not in [geometry_name]:
				properties[key] = value
		# print(f"HERE: {val[geometry_name]}")
		polygon = wkt.loads(val[geometry_name])
		feature.append(geojson.Feature(geometry=polygon, properties=properties))

	#Create a GeoJSON FeatureCollection
	feature_collection = geojson.FeatureCollection(feature)
	return feature_collection

